"   <div class=\"cntnt\" style=\"width: 464px; height: 317px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    The routine CC view (Panel A) shows calcifications in the lateral aspect of the breast. The size, shape and the distribution of these calcifications are better seen on magnification view (Panel B). The pleomorphic appearance and segmental distribution of numerous calcifications oriented towards the nipple is a classic appearance of ductal carcinoma in situ.",
