" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Foamy degeneration in primary biliary cirrhosis",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 386px; height: 260px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Foamy degeneration of hepatocytes adjacent to portal triads in a patient with PBC. There are hyaline droplets in many of these swollen hepatocytes which are similar to those seen in alcoholic hepatitis. The lesion is thought to be due to the toxic effect of retained bile acids (Masson trichrome, x496).",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Marshall M Kaplan, MD.",
"    </div>",
"   </div>",
